import React from "react";
import AliceCarousel from "react-alice-carousel";
import "react-alice-carousel/lib/alice-carousel.css";

const handleDragStart = (e) => e.preventDefault();

const items = [
  <img src="path-to-img" onDragStart={handleDragStart} role="presentation" />,
  <img src="path-to-img" onDragStart={handleDragStart} role="presentation" />,
  <img
    src="https://cdn-images.cure.fit/www-curefit-com/image/upload/fl_progressive,f_auto,q_auto:eco,w_1440,ar_2880:596/dpr_2/image/vm/eef4c65e-f578-4c9b-9106-3a6b30e091dc.png"
    onDragStart={handleDragStart}
    role="presentation"
  />,
];

export const Gallery = () => {
  return <AliceCarousel mouseTracking items={items} />;
};
